import React, { useState, useEffect } from 'react';
var functionFromApi = VeterinariansApiFactory(); 
const SelectVeter = () => {
    const [names, setNames] = useState([]);
    const [data, setData]: any  = useState([]);   
    useEffect(() => {
        // Получите имена из другого компонента, связанного с базой данных
        // и установите их в состояние
        async function getVetDataFromApi() {
            const response = await functionFromApi.apiVeterinariansGet();
            const { data } = response;
            setData(data);
        }
        useEffect(() => {
            getVetDataFromApi();
        }, []);

        
    }, []);

    return (
        <select>
        {names.map((name, index) => (
            <option key={index} value={name}>{name}</option>
        ))}
        </select>
    );
};

export default SelectVeter;
